import React from "react";
import ReactLogo from "./ReactLogo";


const Title = () => {
  return (
    <div className="btn" style={{ cursor: "default" }}>
      <h1>
        <span
          className="me-2"
          style={{
            color: "#61dafb",
            textShadow: "2px 2px 3px rgb(0,88,121)",
          }}
        >
          Blogify
        </span>
      </h1>
    </div>
  );
};

export default Title;
